@kangkaisen 

Doris' result would be cached in BE and wait FE to fetch. But we will remove result cache when it becomes timeout.

`result_buffer_cancelled_interval_time` this config value would influence the timeout. you can change this value to make the result be cached more time.

@kangkaisen 

Our regression test failed because of your unit test. You can check it and fix it.

![image](https://user-images.githubusercontent.com/1249159/56878553-41e27480-6a87-11e9-8995-4fcc893fb4d6.png)

The reason for core dump  is this change:
```
-        std::locale comma_locale(std::locale(), new comma_moneypunct());
+        CommaMoneypunct comma_moneypunct;
+       std::locale comma_locale(std::locale(), &comma_moneypunct);
```
we shouldn't use stack variable, because  `std::locale`  will free  `CommaMoneypunct`. refer to
https://en.cppreference.com/w/cpp/locale/locale/locale


> Notes
Overload 7 is typically called with its second argument, f, obtained directly from a new-expression: the locale is responsible for calling the matching delete from its own destructor.

